import React from 'react';

function subject(){
    return(
        <li class="border-left-0 border-right-0 border-top-0 list-group-item">
            <p>ENG05.K15.CLC - EN</p>
        </li>
    );
}

function SubjectPicker() {
    return(
        <div>
            <form>
                <label for="">Điền mã môn muốn đăng kí</label>
                <textarea class="form-control" id="" style={{resize: "none"}} rows="5"></textarea>
            </form>
            <form>
            <label for="">Chọn môn muốn đăng kí</label>
                <div>
                    <input className="form-control" type="text" placeholder="Search" aria-label="Search"/>
                    <div className="mt-2">
                        <ul style={{height: '50vh', overflow: 'scroll', overflowX: 'hidden'}} className="p-2 border rounded list-group">
                            {subject()}
                        </ul>
                    </div>
                </div>
            </form>
        </div>
    );
}

export default SubjectPicker;
